import React from "react";
import { Link } from "react-router-dom";
import "../App.css";

const Navbar = () => {

  return (
    <div >
      <div >
        <div >
          <Link className="links" to="/reg">Reg</Link>
          <Link className="links" to="/login">Login</Link>
          <Link className="links" to="/home">Home</Link>
          <Link className="links" to="/rolunk">Rolunk</Link>
          <Link className="links" to="/termekek">Termekek</Link>
        </div>
      </div>
    </div>
  );
};
export default Navbar;
